import React from "react";

export default function Card(props) {

  console.log(props)
  return (
    <div className="card">
      <img src={props.imageUrl}></img>
      <section>
        <p>{props.location}Japan</p>
        <span>View on Google Maps</span>
      </section>
    </div>
  )
}
